import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import ListaLivro from './LivroLista';
import './App.css';

function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="teste" element={<ListaLivro/>} />
        </Routes>
      </BrowserRouter>
  );
}

export default App;
